import React from 'react';
import ResponsiveLayout, { MobileContainer, Button } from '../../components/ResponsiveLayout';

const GetStarted = () => {
  const handleGetStarted = () => {
    window.history.pushState({}, '', '/phone-number');
    window.location.reload();
  };

  return (
    <ResponsiveLayout centered fullHeight backgroundType="solid">
      <MobileContainer maxWidth="lg" className="text-center">
        <div className="flex flex-col items-center justify-end min-h-screen-safe pb-8 sm:pb-12">
          <h1 className="text-responsive-2xl font-bold mb-12 sm:mb-16 text-white font-serif">
            Invest in What's Next.
          </h1>

          <Button
            onClick={handleGetStarted}
            variant="primary"
            size="lg"
            fullWidth
            className="max-w-sm"
          >
            Get started
          </Button>
        </div>
      </MobileContainer>
    </ResponsiveLayout>
  );
};

export default GetStarted;
